import React, { useState } from "react";
import { Navbar } from "react-bootstrap";

function Home() {
	const [isOpen, setIsOpen] = useState(true);

	const toggle = () => {
		setIsOpen(!isOpen);
	};

	const mystyle = {
		background: "none",
	};

	return (
		<div style={mystyle}>
			{/* <SideBar isOpen={isOpen} toggle={toggle} /> */}
			<Navbar toggle={{ toggle }} />
		</div>
	);
}

export default Home;
